         "x-kubernetes-list-type": "map"
        },
        "limits": {
         "additionalProperties": {
          "anyOf": [
           {
            "type": "integer"
           },
           {
            "type": "string"
           }
          ],
          "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
          "x-kubernetes-int-or-string": true
         },
         "description": "Limits describes the maximum amount of compute resources allowed.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
         "type": "object"
        },
        "requests": {
         "additionalProperties": {
          "anyOf": [
           {
            "type": "integer"
           },
           {
            "type": "string"
           }
          ],
          "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
          "x-kubernetes-int-or-string": true
         },
         "description": "Requests describes the minimum amount of compute resources required.\nIf Requests is omitted for a container, it defaults to Limits if that is explicitly specified,\notherwise to an implementation-defined value. Requests cannot exceed Limits.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
         "type": "object"
        }
       },
       "type": "object"
      },
      "version": {
       "description": "Version is the Argo CD ApplicationSet image tag. (optional)",
       "type": "string"
      },
      "webhookServer": {
       "description": "WebhookServerSpec defines the options for the ApplicationSet Webhook Server component.",
       "properties": {
        "host": {
         "description": "Host is the hostname to use for Ingress/Route resources.",
         "type": "string"
        },
        "ingress": {
         "description": "Ingress defines the desired state for an Ingress for the Application set webhook component.",
         "properties": {
          "annotations": {
           "additionalProperties": {
            "type": "string"
           },
           "description": "Annotations is the map of annotations to apply to the Ingress.",
           "type": "object"
          },
          "enabled": {
           "description": "Enabled will toggle the creation of the Ingress.",
           "type": "boolean"
          },
          "ingressClassName": {
           "description": "IngressClassName for the Ingress resource.",
           "type": "string"
          },
          "path": {
           "description": "Path used for the Ingress resource.",
           "type": "string"
          },
          "tls": {
           "description": "TLS configuration. Currently the Ingress only supports a single TLS\nport, 443. If multiple members of this list specify different hosts, they\nwill be multiplexed on the same port according to the hostname specified\nthrough the SNI TLS extension, if the ingress controller fulfilling the\ningress supports SNI.",
           "items": {
            "description": "IngressTLS describes the transport layer security associated with an ingress.",
            "properties": {
             "hosts": {
              "description": "hosts is a list of hosts included in the TLS certificate. The values in\nthis list must match the name/s used in the tlsSecret. Defaults to the\nwildcard host setting for the loadbalancer controller fulfilling this\nIngress, if left unspecified.",
              "items": {
               "type": "string"
              },
              "type": "array",
              "x-kubernetes-list-type": "atomic"
             },
             "secretName": {
              "description": "secretName is the name of the secret used to terminate TLS traffic on\nport 443. Field is left optional to allow TLS routing based on SNI\nhostname alone. If the SNI host in a listener conflicts with the \"Host\"\nheader field used by an IngressRule, the SNI host is used for termination\nand value of the \"Host\" header is used for routing.",
              "type": "string"
             }
            },
            "type": "object"
           },
           "type": "array"
          }
         },
         "required": [
          "enabled"
         ],
         "type": "object"
        },
        "route": {
         "description": "Route defines the desired state for an OpenShift Route for the Application set webhook component.",
         "properties": {
          "annotations": {
           "additionalProperties": {
            "type": "string"
           },
           "description": "Annotations is the map of annotations to use for the Route resource.",
           "type": "object"
          },
          "enabled": {
           "description": "Enabled will toggle the creation of the OpenShift Route.",
           "type": "boolean"
          },
          "labels": {
           "additionalProperties": {
            "type": "string"
           },
           "description": "Labels is the map of labels to use for the Route resource",
           "type": "object"
          },
          "path": {
           "description": "Path the router watches for, to route traffic for to the service.",
           "type": "string"
          },
          "tls": {
           "description": "TLS provides the ability to configure certificates and termination for the Route.",
           "properties": {
            "caCertificate": {
             "description": "caCertificate provides the cert authority certificate contents",
             "type": "string"
            },
            "certificate": {
             "description": "certificate provides certificate contents. This should be a single serving certificate, not a certificate\nchain. Do not include a CA certificate.",
             "type": "string"
            },
            "destinationCACertificate": {
             "description": "destinationCACertificate provides the contents of the ca certificate of the final destination.  When using reencrypt\ntermination this file should be provided in order to have routers use it for health checks on the secure connection.\nIf this field is not specified, the router may provide its own destination CA and perform hostname validation using\nthe short service name (service.namespace.svc), which allows infrastructure generated certificates to automatically\nverify.",
             "type": "string"
            },
            "externalCertificate": {
             "description": "externalCertificate provides certificate contents as a secret reference.\nThis should be a single serving certificate, not a certificate\nchain. Do not include a CA certificate. The secret referenced should\nbe present in the same namespace as that of the Route.\nForbidden when `certificate` is set.",
             "properties": {
              "name": {
               "description": "name of the referent.\nMore info: https://kubernetes.io/docs/concepts/overview/working-with-objects/names/#names",
               "type": "string"
              }
             },
             "type": "object",
             "x-kubernetes-map-type": "atomic"
            },
            "insecureEdgeTerminationPolicy": {
             "description": "insecureEdgeTerminationPolicy indicates the desired behavior for insecure connections to a route. While\neach router may make its own decisions on which ports to expose, this is normally port 80.\n\n* Allow - traffic is sent to the server on the insecure port (edge/reencrypt terminations only) (default).\n* None - no traffic is allowed on the insecure port.\n* Redirect - clients are redirected to the secure port.",
             "enum": [
              "Allow",
              "None",
              "Redirect",
              ""
             ],
             "type": "string"
            },
            "key": {
             "description": "key provides key file contents",
             "type": "string"
            },
            "termination": {
             "description": "termination indicates termination type.\n\n* edge - TLS termination is done by the router and http is used to communicate with the backend (default)\n* passthrough - Traffic is sent straight to the destination without the router providing TLS termination\n* reencrypt - TLS termination is done by the router and https is used to communicate with the backend\n\nNote: passthrough termination is incompatible with httpHeader actions",
             "enum": [
              "edge",
              "reencrypt",
              "passthrough"
             ],
             "type": "string"
            }
           },
           "required": [
            "termination"
           ],
           "type": "object",
           "x-kubernetes-validations": [
            {
             "message": "cannot have both spec.tls.termination: passthrough and spec.tls.insecureEdgeTerminationPolicy: Allow",
             "rule": "has(self.termination) \u0026\u0026 has(self.insecureEdgeTerminationPolicy) ? !((self.termination=='passthrough') \u0026\u0026 (self.insecureEdgeTerminationPolicy=='Allow')) : true"
            }
           ]
          },
          "wildcardPolicy": {
           "description": "WildcardPolicy if any for the route. Currently only 'Subdomain' or 'None' is allowed.",
           "type": "string"
          }
         },
         "required": [
          "enabled"
         ],
         "type": "object"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
